/* package.json */
/* "react-native-paper": "4.9.2",   Components, Reference: https://callstack.github.io/react-native-paper */
/* "@expo/vector-icons":"^13.0.0"  Native app, Reference: https://expo.github.io/vector-icons */

import { Text, SafeAreaView, StyleSheet } from 'react-native';

import { Card } from 'react-native-paper';

import AssetExample from './components/AssetExample';

export default function APP() {
    return ( 
    <SafeAreaView style={StyleSheet.container}>
        <Text style={StyleSheet.paragraph}>
            C4hun's Profil
        </Text>
        <Card>
            <AssetExample />
        </Card>
    </SafeAreaView>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'Center',
        backgroundColor: '#ecf0f1',
        padding: 8,
    },
    paragraph: {
        margin: 24,
        fontSize: 18,
        fontWeight: 'bold',
        textAlign: 'center',
    },
});
